const SECRET_KEY = "codexflow-secret-key";

function base64ToBinary(encoded: string): string {
  if (typeof atob === "function") return atob(encoded);
  const g: any = globalThis as any;
  if (g.Buffer) return g.Buffer.from(encoded, "base64").toString("binary");
  throw new Error("Base64 decode not supported in this environment.");
}

function decodeAsset(encoded: string): string {
  const binary = base64ToBinary(encoded);
  let result = "";
  for (let i = 0; i < binary.length; i++) {
    const decoded = binary.charCodeAt(i) ^ SECRET_KEY.charCodeAt(i % SECRET_KEY.length);
    result += String.fromCharCode(decoded);
  }
  return result;
}

export const ALIPAY_QR_DATA_URL = decodeAsset("");
export const WECHAT_QR_DATA_URL = decodeAsset("");
export const PAYPAL_ME_URL = decodeAsset("CxsQFQtcQ0AHTAoVAh5LGUhECQwPGiYEGh81AA==");
